import { jsPDF } from "jspdf";
var font =
  "";
var callAddFont = function() {
  this.addFileToVFS("Roboto-Regular-webfont-normal.ttf", font);
  this.addFont(
    "Roboto-Regular-webfont-normal.ttf",
    "Roboto-Regular-webfont",
    "normal"
  );
};
jsPDF.API.events.push(["addFonts", callAddFont]);
